THE LOS ANGELES CITY COUNCIL PRESENTS Brenda Gutierrez, FOUNDER OF ME TOO March International & COMMUNITY ORGANIZER was awarded with CITY RECOGNITION FOR HER COMMUNITY WORK & LEADERSHIP IN LOS ANGELES. 
Brenda Gutierrez thank you for all that you do for #MeToo Survivors & for various causes in #LosAngeles. The Me Too family is extremely proud of you & we are grateful for your dedication to the Los Angeles community. You deserve this recognition and many more & we are grateful & humbled to carry on Tarana Burke’s founding message. ✊🏽✊🏽✊🏽✊🏽✊🏽 📸 by #SteadyJenny
